	@Test
	public void testEncryption(){
		for(TestVector tv:TEST_VECTORS){
			long ciphertext=XTEA.encrypt(tv.plaintext, tv.key);
			assertEquals(tv.ciphertext, ciphertext);
		}
	}

	@Test
	public void testDecryption(){
		for(TestVector tv:TEST_VECTORS){
			long plaintext=XTEA.decrypt(tv.ciphertext, tv.key);
			assertEquals(tv.plaintext, plaintext);
		}
	}

	private record TestVector(int[] key, long plaintext, long ciphertext){}
